import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Header from "../header/header";
import Footer from "../footer/Footer";
import "./basket.css";

const Baskets = () => {
  const [basketItems, setBasketItems] = useState([
    { id: 1, name: "Royal Cheese Burger", description: "With extra fries", price: 120, quantity: 1 },
    { id: 2, name: "Potato Veggies", description: "No Mushrooms + green peppers", price: 70, quantity: 1 },
    { id: 3, name: "Coke Coca Cola", description: "", price: 40, quantity: 1 },
  ]);
  const [addedProducts, setAddedProducts] = useState(new Set());

  const navigate = useNavigate();

  // Handle adding products to the basket
  const handleAddToCart = (newItem) => {
    const itemIndex = basketItems.findIndex((item) => item.id === newItem.id);

    if (itemIndex >= 0) {
      const updatedItems = [...basketItems];
      updatedItems[itemIndex].quantity += 1;
      setBasketItems(updatedItems);
    } else {
      setBasketItems([...basketItems, { ...newItem, quantity: 1 }]);
    }

    setAddedProducts((prev) => new Set(prev).add(newItem.id));

    // Reset the added state after a timeout
    setTimeout(() => {
      setAddedProducts((prev) => {
        const updatedSet = new Set(prev);
        updatedSet.delete(newItem.id);
        return updatedSet;
      });
    }, 3000); // Reset after 3 seconds
  };

  const handleRemoveFromCart = (itemId) => {
    const updatedItems = basketItems.filter((item) => item.id !== itemId);
    setBasketItems(updatedItems);
  };

  const subTotal = basketItems.reduce((total, item) => total + item.price * item.quantity, 0);
  const discount = 3;
  const deliveryFee = 3;
  const total = subTotal - discount + deliveryFee;

  const handleCheckout = () => {
    navigate("/checkout");
  };

  return (
    <div>
      <Header />

      {/* Products */}
      <section>
        <h3>Burgers</h3>
        <div className="category-cards">
          {basketItems.map((item) => (
            <div className="product-card" key={item.id}>
              <div className="content">
                <h2>{item.name}</h2>
                <p>{item.description}</p>
                <h2>₹ {item.price}</h2>
              </div>
              <div className="images">
                <button
                  onClick={() => handleAddToCart({ id: item.id, name: item.name, price: item.price })}
                  disabled={addedProducts.has(item.id)}
                >
                  {addedProducts.has(item.id) ? "Added to Basket" : "Add to Basket"}
                </button>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Basket */}
      <div className="basket-container">
        <header className="basket-header">
          <span>My Basket</span>
        </header>
        <div className="basket-items">
          {basketItems.map((item) => (
            <div className="basket-item" key={item.id}>
              <div>{item.quantity}x</div>
              <div>{item.name}</div>
              <div>₹{item.price * item.quantity}</div>
              <button onClick={() => handleRemoveFromCart(item.id)}>Remove</button>
            </div>
          ))}
        </div>
        <div>Total: ₹{total.toFixed(2)}</div>
        <button onClick={handleCheckout}>Checkout</button>
      </div>

      <Footer />
    </div>
  );
};

export default Baskets;
